import React from "react";
import { FaRedo, FaCopy, FaSave, FaShareAlt } from "react-icons/fa";


const TripOutputPage = ({ trip }) => {
    return (
        <div className="w-full min-h-screen bg-white">
            {/* Header Section */}
            <div className="relative w-full h-80 bg-cover bg-center" style={{ backgroundImage: `url(${trip.image})` }}>
                <div className="absolute inset-0 bg-black bg-opacity-30 flex items-center justify-center">
                    <h1 className="text-white text-4xl font-bold text-center px-4">{trip.title}</h1>
                </div>
            </div>

            {/* Trip Details */}
            <div className="max-w-4xl mx-auto p-6">
                <div className="flex items-center space-x-4 mb-4">
                    <span className="px-3 py-1 bg-gray-200 rounded-full text-sm">{trip.days} days</span>
                    <span className="px-3 py-1 bg-gray-200 rounded-full text-sm">{trip.destination}</span>
                    <span className="px-3 py-1 bg-gray-200 rounded-full text-sm">{trip.style}</span>
                </div>

                {/* Action Buttons */}
                <div className="flex space-x-4 mb-6">
                    <Button variant="outline"><FaRedo className="mr-2" /> Rerun</Button>
                    <Button variant="outline"><FaCopy className="mr-2" /> Copy</Button>
                    <Button variant="outline"><FaSave className="mr-2" /> Save</Button>
                    <Button variant="outline"><FaShareAlt className="mr-2" /> Share</Button>
                </div>

                {/* Itinerary Section */}
                {trip.itinerary.map((day, index) => (
                    <Card key={index} className="mb-6">
                        <CardContent className="p-4">
                            <h2 className="text-xl font-semibold">Day {index + 1} - {day.location}</h2>
                            {day.activities.map((activity, i) => (
                                <div key={i} className="mt-4">
                                    <p className="text-sm text-gray-600">{activity.time}</p>
                                    <h3 className="text-lg font-medium">{activity.title}</h3>
                                    <p className="text-gray-500">{activity.description}</p>
                                </div>
                            ))}
                        </CardContent>
                    </Card>
                ))}
            </div>
        </div>
    );
};

export default TripOutputPage;
